import React from 'react';
import { NavLink } from 'react-router-dom';

function AHeader() {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-white fixed-top shadow-sm py-3">
      <div className="container">

        {/* LOGO */}
        <NavLink className="navbar-brand fw-bold fs-3" to="/">
          Known
        </NavLink>

        {/* TOGGLE */}
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarNav"
        >
          <span className="navbar-toggler-icon"></span>
        </button>

        {/* MENU */}
        <div className="collapse navbar-collapse" id="navbarNav">

          {/* CENTER MENU */}
          <ul className="navbar-nav mx-auto gap-3">
            <li className="nav-item">
              <NavLink className="nav-link nav-big" to="/">Home</NavLink>
            </li>

            <li className="nav-item">
              <NavLink className="nav-link nav-big" to="/About">About</NavLink>
            </li>

            <li className="nav-item">
              <NavLink className="nav-link nav-big" to="/Teachers">OurTeachers</NavLink>
            </li>

            <li className="nav-item">
              <NavLink className="nav-link nav-big" to="/Courses">Courses</NavLink>
            </li>

            <li className="nav-item">
              <NavLink className="nav-link nav-big" to="/Reviews">Reviews</NavLink>
            </li>

            <li className="nav-item">
              <NavLink className="nav-link nav-big" to="/Contact">Contact</NavLink>
            </li>

            <li className="nav-item">
              <NavLink className="nav-link nav-big" to="/Login">Login</NavLink>
            </li>
          </ul>

          {/* RIGHT PHONE */}
          <div className="d-none d-lg-block">
            <a href="tel:+6522441100" className="nav-link fw-semibold">
              <i className="fa fa-phone me-2"></i> +65 2244 1100
            </a>
          </div>

        </div>
      </div>
    </nav>
  );
}

export default AHeader;
